void InitButtonDialog(WM_MESSAGE *pMsg)
{
	WM_HWIN hWin;
	hWin = pMsg->hWin;
	FRAMEWIN_SetTitleHeight(hWin, 30);
	FRAMEWIN_SetText(hWin, "FOURIER INTELLIGENCE BUTTON");
	FRAMEWIN_SetFont(hWin, GUI_FONT_24_ASCII);
	FRAMEWIN_SetTextAlign(hWin, GUI_TA_HCENTER | GUI_TA_VCENTER);
	FRAMEWIN_SetTextColor(hWin, 0x0000FFFF);
}

static void _cbAPPDialog(WM_MESSAGE * pMsg) 
{
	WM_HWIN hItem;
	int     NCode;
	int     Id;
	static u8 ledflag=0;

	switch (pMsg->MsgId) 
	{
		case WM_PAINT:
			GUI_SetBkColor(GUI_WHITE);
			GUI_Clear();
			break;
		case WM_INIT_DIALOG:
			//
			InitButtonDialog(pMsg);
			//BUTTON0
			hItem = WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0);
			BUTTON_SetBitmapEx(hItem,0,&buttonbmp_tab[0],0,0);
			BUTTON_SetText(hItem, "");
			
			//BUTTON1
			hItem = WM_GetDialogItem(pMsg->hWin, ID_BUTTON_1);
			BUTTON_SetText(hItem, "Exit");
			
			//TEXT0
			hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_0);
			TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
			TEXT_SetFont(hItem, GUI_FONT_32_ASCII);
			TEXT_SetText(hItem, "LED1:");
			
			//TEXT1
			hItem = WM_GetDialogItem(pMsg->hWin, ID_TEXT_1);
			TEXT_SetTextAlign(hItem, GUI_TA_HCENTER | GUI_TA_VCENTER);
			TEXT_SetFont(hItem, GUI_FONT_32_ASCII);
			TEXT_SetText(hItem, "Exit To Desktop");
			break;
		case WM_NOTIFY_PARENT:
			Id    = WM_GetId(pMsg->hWinSrc);
			NCode = pMsg->Data.v;
			switch(Id) 
			{
				case ID_BUTTON_0:
					hItem = WM_GetDialogItem(pMsg->hWin, ID_BUTTON_0);
					switch(NCode) 
					{
						case WM_NOTIFICATION_CLICKED:
							break;
						case WM_NOTIFICATION_RELEASED:
							LED1=~LED1;	
							ledflag=~ledflag;
							BUTTON_SetBitmapEx(hItem,0,ledflag?&buttonbmp_tab[1]:&buttonbmp_tab[0],0,0);	
							break;	
					}
					break;
				case ID_BUTTON_1: 
					hItem = pMsg->hWin;
					GUI_EndDialog(hItem,0);
					switch(NCode) 
					{
						case WM_NOTIFICATION_CLICKED:
							break;
						case WM_NOTIFICATION_RELEASED:
							break;
					}
					break;
			}
			break;
		default:
			WM_DefaultProc(pMsg);
			break;
	}
}

WM_HWIN CreateWindow2(void) 
{
	WM_HWIN hWin;
	buttonbmp_tab[0]=bmBUTTONOFF;
	buttonbmp_tab[1]=bmBUTTONON;
	hWin = GUI_CreateDialogBox(_aDialogCreate, GUI_COUNTOF(_aDialogCreate), _cbAPPDialog, WM_HBKWIN, 0, 0);
	return hWin;
}

void Buttonbmp_Demo(void)
{
	CreateWindow2();
}



